import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import CreateAccount from "./Pages/01_CreateAccount";

import "./App.css";
import { Account } from "@solana/web3.js";

const Home = () => {
  const createCoin = async (string) => {
    await new Account(string);
    console.log("yay");
  };

  return (
    <div className="App">
      <header className="App-header">
        <Link to="/about">Get started with Solana!</Link>
        <button onClick={() => createCoin()}>Create Coin</button>
      </header>
    </div>
  );
};

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/about">
          <CreateAccount />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
